INSERT INTO `Page` (`adresse`, `titre`, `description`) VALUES
('/', 'Accueil', 'Dans l''avenir, l''interaction entre les appareils &eacute;lectroniques sera omnipr&eacute;sente. L''outil principal de cette interaction est maintenant le Smartphone. Nous avons choisi de travailler sur la communication entre l''&eacute;lectronique dans l''automobile et les applications web et mobiles. La r&eacute;alisation de cette communication via un Smartphone est con&ccedil;ue pour l''industrie automobile. Par cons&eacute;quent, le public cibl&eacute; correspond aux propri&eacute;taires de v&eacute;hicules qui ont un Smartphone et qui souhaitent contr&ocirc;ler l''&eacute;quipement de leurs voitures. L&#146;avenir d''une telle technologie est d''interagir avec un v&eacute;hicule et d''obtenir toutes les informations concernant celui-ci.<p / >   Le premier objectif de notre projet est de construire une application embarqu&eacute;e permettant la r&eacute;cup&eacute;ration de donn&eacute;es circulant sur le bus CAN d&#146;un v&eacute;hicule. Ce module de r&eacute;cup&eacute;ration est r&eacute;alis&eacute; de sorte qu&#146;il puisse fonctionner pour plusieurs marques automobiles et qu&#146;il soit facilement adaptable aux normes des constructeurs. Il se connecte ensuite, via le r&eacute;seau 3G, &agrave; une base de donn&eacute;es pour stocker en temps r&eacute;el l&#146;int&eacute;gralit&eacute; des informations du v&eacute;hicule de l&#146;utilisateur. L&#146;objectif est de d&eacute;velopper une version g&eacute;n&eacute;rique et modulaire de cette base de donn&eacute;es afin d&#146;en permettre une utilisation simple et efficace et ainsi cibler une large communaut&eacute; d''utilisateurs. Enfin, la consultation de cette base de donn&eacute;es permettra d&#146;&eacute;tablir un diagnostic sur le v&eacute;hicule. Cette consultation se r&eacute;alisera par le biais de cette interface Web fonctionnant aussi bien sur les ordinateurs que sur les Smartphones. Il serait &eacute;galement int&eacute;ressant de travailler sur diff&eacute;rents syst&egrave;mes d''exploitation de Smartphone tels qu&#146;iOS,Android, Symbian OS, Windows Mobile ou BlackBerry OS.'),
