sur diff&eacute;rents syst&egrave;mes d''exploitation de Smartphone tels qu&#146;iOS,Android, Symbian OS, Windows Mobile ou BlackBerry OS.'),
('/index/team', 'Notre &eacute;quipe', 'Form&eacute;e en juillet 2011, notre &eacute;quipe est compos&eacute;e de quatre &eacute;l&egrave;ves ing&eacute;nieurs, de 22 &agrave; 24 ans, tous &eacute;tudiants &agrave; l&ldquo;ECE. Tous passionn&eacute;s d''automobile et de nouvelles technologies, nous nous sommes vraiment impliqu&eacute;s dans ce projet &agrave; fort potentiel. Voici l''organigramme de notre &eacute;quipe:'),
